                    <div className="namePrev">{data.intro.name}</div>  
                    <div className="addressPrev">{data.intro.address}</div>            
            </div>

            <div className="workExpPreviewDiv">
                    {/* <div className="titleWorkExpDiv">{data.intro.title}</div>   */}
            </div>
        </div>
      );  
    }
}

export default PreviewSide;
